/* copyright dynamic year change */
$(document).ready(function() {
	$('.footer-links-group .fb-links > span:first-child').each(
		function() {
			var text = $(this).text();
			var s2 = text.split(" ");
			cpyyr = new Date();
			x = cpyyr.getFullYear();
			for (i = 0; i < s2.length; i++) {

				if ((!(s2[i].indexOf('1'))) || (!(s2[i].indexOf('2'))) || (!(s2[i].indexOf('3')))) {

					$(this).text(text.replace(s2[i], x));

				}
			}
		});
})
